export function SearchSvg() {
  return (
    <svg
      version="1.2"
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 19 20"
      width="19"
      height="20"
    >
      <title>mobile</title>
      <defs>
        <image
          width="17"
          height="19"
          id="img1"
          href="data:image/png;base64,"
        />
      </defs>
      <g id="header">
        <g id="search">
          <g id="default">
            <use
              id="icon_search"
              href="#img1"
              transform="matrix(1,0,0,1,1,1)"
            />
          </g>
        </g>
      </g>
    </svg>
  );
}
